import React from 'react';

import classes from './message.module.css'

function message() {
    return (
        <div className={classes.Message}>
            <p>El producto ya fue agregado a tu carrito!</p>
            <button className={classes.seguirComprandoBtn}>Seguir comprando</button>
            <button className={classes.procederAlPagoBtn}>Proceder al pago</button>
        </div>
    )
}

export default message;
